export function add08(a: number, b: number): number {
  return a + b;
}

export function subtract08(a: number, b: number): number {
  return a - b;
}

export function multiply08(a: number, b: number): number {
  return a * b;
}

export function divide08(a: number, b: number): number {
  return a / b;
}
